import React from "react";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import { KanbanView } from "./components/task/KanbanView";

function App() {
  return (
    <Router>
      <div className="App">
        <h1>Project Management App</h1>
        <Routes>
          <Route path="/" element={<KanbanView />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
